Está sendo divulgado em mídias ocupações em escolas públicas e Institutos Federais pelo País contra  medida provisória que prevê a reforma do ensino médio. 

Os secundaristas se posicionam contra a Medida Provisória da Reforma do Ensino Médio. Já segundo o perfil Mídia Ninja, os estudantes devem paralisar mais de 70 instituições de ensino em dez estados.

Relacionamos em 29/09/2016 a 06/10/2016 as escolas que requerem atenção devido a ocupação. As escolas relacionadas( por UF, Município e Qdt de inscritos) são unidades que terão aplicação de provas nos dias 05 e 06 de novembro/2016.

